import React, { useState, useEffect } from 'react';
import axios from 'axios';

function Residents() {
  const [residents, setResidents] = useState([]);

  useEffect(() => {
    // Fetch residents data from the backend API
    const fetchResidents = async () => {
      try {
        const response = await axios.get('http://localhost:8000/api/users');
        setResidents(response.data);
      } catch (error) {
        console.error('Error fetching residents:', error);
      }
    };

    fetchResidents();
  }, []);

  return (
    <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center', padding: '20px' }}>
      <h2 style={{ marginBottom: '20px' }}>Residents</h2>
      <div style={{ width: '80%' }}>
        <table style={{ width: '100%', borderCollapse: 'collapse' }}>
          <thead>
            <tr>
              <th style={{ border: '1px solid #ddd', padding: '8px', textAlign: 'left' }}>Name</th>
              <th style={{ border: '1px solid #ddd', padding: '8px', textAlign: 'left' }}>Email</th>
              <th style={{ border: '1px solid #ddd', padding: '8px', textAlign: 'left' }}>Phone</th>
            </tr>
          </thead>
          <tbody>
            {residents.map(resident => (
              <tr key={resident._id}>
                <td style={{ border: '1px solid #ddd', padding: '8px' }}>{resident.name}</td>
                <td style={{ border: '1px solid #ddd', padding: '8px' }}>{resident.email}</td>
                <td style={{ border: '1px solid #ddd', padding: '8px' }}>{resident.phone}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}

export default Residents;
